    data: |
      SELECT DISTINCT - - col1 * + col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col2 > 55 * - col0 * - col1;
  - name: tab1

outputs:
  - name: q9549.out
    data: |
      425
      4277
      714
